import { SquareValue } from "../../type";
import NextPlayer from "./NextPlayer";

type movesProps = {
    history : SquareValue[][] | null,
    nextPlayer : String
}

const Moves: React.FC<movesProps> = (props) => {
    return (
        <NextPlayer nextPlayer={props.nextPlayer}></NextPlayer>
    )
}

export default Moves;
